import {Component} from 'react';
import { StudentConsumer } from './StudentInfo';

class Course extends Component{

    render(){
        return(
            <StudentConsumer>
                {
                    value=>{
                        return(
                            <div>
                                <center>
                                <h1>Student Info</h1>
                                <br>
                                </br>
                                <hr>
                                </hr>
                                <h3>{value.id}</h3>
                                <br></br>
                                <h3>{value.course}</h3>
                                <br></br>
                                <h3>{value.age}</h3>
                                <br></br>
                                <h3>{value.package1}</h3>
                                <br></br>
                                <br></br>
                                </center>
                            </div>
                        )
                    }
                }
            </StudentConsumer>
        )
    }
}
export default Course;
